configure:
  commands:
    end:
      new_state: execute
    interface Port-channel 15: "interface Port-channel 15\r\n"
    line console 0:
      new_state: configure_line
    no logging console: ''
    no port-channel standalone-disable: "no port-channel standalone-disable\r\n"
  prompt: Cat9600HA_DUT1(config)#
configure_line:
  commands:
    end:
      new_state: execute
    exec-timeout 0: ''
  prompt: Cat9600HA_DUT1(config-line)#
connect:
  commands:
    ? ''
    : new_state: execute
  preface: 'Trying mock_device ...

    Connected to mock_device.

    Escape character is ''^]''.'
  prompt: ''
execute:
  commands:
    config term:
      new_state: configure
    config-transaction:
      new_state: configure
    show version: ''
    term length 0: ''
    term width 0: ''
  prompt: Cat9600HA_DUT1#
